import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { useEffect } from "react";
import { useDispatch } from "react-redux";

import "./App.css";
import Sidebar from "./components/Sidebar";
import CreateTeam from "./pages/createTeam";
import HomeTour from "./pages/homeTour";
import Calendar from "./pages/Calendar";

import { GlobalStyle } from "./globalStyledComponent";
import "bootstrap/dist/css/bootstrap.min.css";
import { fetchTeams } from "./actions/teams.js";
import { fetchCalendar } from "./actions/calendar.js";

function App() {
    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(fetchTeams());
        dispatch(fetchCalendar());
    }, [dispatch]);

    return (
        <div>
            <GlobalStyle />
            <Router>
                <Sidebar />
                <Switch>
                    <Route exact path="/">
                        <HomeTour />
                    </Route>
                    <Route exact path="/tour">
                        <HomeTour />
                    </Route>
                    <Route exact path="/tour/newteam">
                        <CreateTeam />
                    </Route>
                    <Route exact path="/tour/calendar">
                        <Calendar />
                    </Route>
                </Switch>
            </Router>
        </div>
    );
}

export default App;
